import React,{Component} from "react"

class Results extends Component {
    constructor(props) {
      super(props);

      // Set initial state
      this.state = { name: "Survey",msg: "Hi, There!" };

      // Binding this keyword
      this.handleClick = this.handleClick.bind(this);
    }

    handleClick() {
      // Changing state
      this.setState({ msg: "Welcome to the React world!" });
    }

    render() {
      return (
        <div>
          <p>{this.state.msg}</p>

          <div>
            <button onClick={this.handleClick} className="button-one">
              <strong>Fill out Survey</strong>
            </button>
            <br />
          </div>
          </div>


      );
    }
  }

  export default Results;
